    <div className="card-container">
      <div className="board">
        <div className="row">{Row}</div>
        <div className="row">{Row}</div>
        <div className="row">{Row}</div>
        <div className="row">{Row}</div>
        <div className="row">{Row}</div>
        <div className="row">{Row}</div>
        <div className="row">{Row}</div>
        <div className="row">{Row}</div>
      </div>
      <h2 className="card-title">Chess Board</h2>
    </div>
  );
};

export default Card;
